import React from "react";
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { useNavigate } from "react-router-dom";
import globalConstants from "../globalConstants";

export default function Dashboard() {

  const adminRoleId = globalConstants.ROLE_ID.Admin
  const customerRoleId = globalConstants.ROLE_ID.Customer;


  console.log(adminRoleId)
  console.log(customerRoleId)


  const navigate = useNavigate();
  const logout = () => {
    navigate('/');
    // sessionStorage.clear();
  }
  if (adminRoleId === 1) {
    return (
      <div>
        <Navbar bg="primary" data-bs-theme="dark">
          <Container>
            <Navbar.Brand href="#home">Navbar</Navbar.Brand>
            <Nav className="me-auto">
              <Nav.Link href="#home">Home</Nav.Link>
              <Nav.Link href="/users">Users</Nav.Link>
              <Nav.Link href="#manage">Manage</Nav.Link>
              <Nav.Link onClick={logout}>Logout</Nav.Link>
            </Nav>
          </Container>
        </Navbar>
      </div>
    );
  }
  else if (customerRoleId === 2) {
    return (
      <div>
        <Navbar bg="primary" data-bs-theme="dark">
          <Container>
            <Navbar.Brand href="#home">Navbar</Navbar.Brand>
            <Nav className="me-auto">
              <Nav.Link href="#home">Home</Nav.Link>
              <Nav.Link href="#features">Customer Menu</Nav.Link>
              <Nav.Link href="#pricing">Customer List</Nav.Link>
              <Nav.Link onClick={logout}>Logout</Nav.Link>
            </Nav>
          </Container>
        </Navbar>
      </div>
    );
  }
  else {
    return (
      <div>
        <Navbar bg="primary" data-bs-theme="dark">
          <Container>
            <Navbar.Brand href="#home">Navbar</Navbar.Brand>
            <Nav className="me-auto">
              <Nav.Link href="#home">Home</Nav.Link>
              <Nav.Link href="#features">Owner Features</Nav.Link>
              <Nav.Link href="#pricing">Chef Menu</Nav.Link>
              <Nav.Link onClick={logout}>Logout</Nav.Link>
            </Nav>
          </Container>
        </Navbar>
      </div>
    );
  }
}
